import React from "react";
import { useNavigate } from "react-router-dom";
import backgroundImage from "assets/images/54e21663-f198-4c7f-8379-98444080342f.webp"; // Adjust the path as necessary
import "./styles.css"; // Ensure this path is correct

function Home() {
  const navigate = useNavigate(); // Hook to access the navigate function

  // Function to handle navigation to the login page
  const handleLoginNavigate = () => {
    navigate("/login"); // Adjust the route as necessary
  };

  return (
    <div
      className="home-container"
      style={{ backgroundImage: `url(${backgroundImage})` }}
    >
      <div className="content">
        <h1>Welcome to BMW Cars</h1>
        <button className="login-button" onClick={handleLoginNavigate}>
          Login
        </button>
      </div>
    </div>
  );
}

export default Home;
